import React, {Component} from 'react';
import Header from '../components/Header.js'

class Home extends Component {
    render() {
        return (
            <div>
                <Header></Header>
                <div className="contain">
                    <p className="section">Find your perfect trip, designed by insiders who know and love their cities.</p>
                    <div className="section">
                        <img className="circle" src={require("../images/circled-right.png")} alt="circle"/>
                    </div>
                    <div className="section popularCities">
                        <h5>Popular MYtinerary</h5>
                        <div>

                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
